import React, {Component} from 'react';
export default class News extends Component {
    render(){
        return (
            <div className='border-top relative t-14'>
                <div className="marquee">
                    <ul className="flex centering">
                        <li>Dashboard</li>
                        <li>Notification</li>
                        <li>Settings</li>
                    </ul>
                </div>
            </div>
        )
    }
}
